import React, { Component } from "react";
import Modal from 'react-modal';
import { bindActionCreators } from "redux";
import { connect } from "react-redux";

class MyModal extends Component {
    constructor(props) {
        super(props);       
      }
      
    
      render() {
        const {
            title, isOpen, askToClose,
            onAfterOpen, onRequestClose, onChangeInput
          } = this.props;
        return (
            <Modal
            id="test"
            contentLabel="modalA"
            closeTimeoutMS={150}
            isOpen={isOpen}
            onAfterOpen={onAfterOpen}
            onRequestClose={onRequestClose}>
            <h1>{title}</h1>
            <button onClick={askToClose}>close</button>
            <div>I am a modal. Use the first input to change the modal's title.</div>
            <form>
                <input onChange={onChangeInput} />
                <input />
                <br />
                <button>Button A</button>
                <button>Button B</button>
                <button>Button C</button>
                <button>Button D</button>
            </form>
            </Modal>
        );
      }
}

function mapDispatchToProps(dispatch) {
    return bindActionCreators({}, dispatch);
}
export default connect(null, mapDispatchToProps)(MyModal);
